ComponentPointer Adj5colorComponentFactory::create(std::string name) {
    return std::make_shared<Adj5colorComponent>(name);
}

Adj5colorComponent::Adj5colorComponent(std::string name) : Component(name) {}

void Adj5colorComponent::process(RequestStatusPointer request) {
    if (request->adj == "none") {
        return;
    }
    std::string style;
    switch (request->request_type) {
        case RequestStatus::RequestType::Abstract:
            style = "抽象派";
            break;
        case RequestStatus::RequestType::PostImpressionism:
            style = "后印象派";
            break;
        case RequestStatus::RequestType::Pointillism:
            style = "点彩派";
            break;
        case RequestStatus::RequestType::Shuimo:
            style = "shuimo";
            break;
        case RequestStatus::RequestType::Suprematism:
            style = "至上主义";
            break;
        case RequestStatus::RequestType::Impressionism:
            style = "印象派";
            break;
    }
    std::string index = request->adj + "_" + style;
    if (map_5c_.count(index) == 0) {
        request->adj = "none";
        return;
    }
    auto v5c = map_5c_.at(index);
    for (int i = 0; i < 15; ++i) {
        request->ref_attr.five_color[i/3][i%3] = v5c[i];
    }
}

